import Banner from '../assets/Supr-Skin-facebook-cover-double.jpg';
import Logo from '../assets/SuprSkin.png';

const regimen = [
    ashwaghandaRegimen = {
    title: ashwaghandaRegimen,
    products: {
        ashwaghandaSerum,
        ashwaghandaScrub,
        ashwaghandaTea
    }

}]

function Regimen() {
  return (
    <div className="main-page">
        <div className='title-holder'>
          <h4>Regimen Finder</h4>
        </div>
        <div className='regimen-holder'>
         <div className='regimen'>
          <h2></h2>
         </div>
        </div>
    </div>
  );
}

export default Regimen;
